/**
 * @fileoverview Definitions for console logging.
 * @externs
 */

/** @type {Object} */
var console = {};

/**
 * @param {...*} var_args The message(s) to log.
 * @return {void} Nothing.
 */
console.log = function(var_args) {};

/**
 * @param {...*} var_args The message(s) to log.
 * @return {void} Nothing.
 */
console.error = function(var_args) {};

/**
 * @param {...*} var_args The message(s) to log.
 * @return {void} Nothing.
 */
console.warn = function(var_args) {};
